import React, { useState } from "react";
import { Form, Input } from "antd-mobile";
import {
  View,
  SafeAreaView,
  Text,
  Image,
  StyleSheet,
  StatusBar,
  TouchableOpacity,
  Dimensions,
  ScrollView,
  PixelRatio,
  Alert,
} from "react-native";
import { COLORS, SIZES, FONTS } from "../constants/theme";
import _ from "lodash";
import { newDummyData } from "../index";
import { multiCoinStatus } from "../constants/newDummy";

const Withdraw = ({ route }) => {
  const [transactionFee, setTransactionFee] = useState("");
  const [transactionFeeAud, setTransactionFeeAud] = useState("");
  const [sendCrypto, setSendCrypto] = useState("");
  const [sendAud, setSendAud] = useState("");
  const { currencyItem } = route.params;
  const [currentCurrency, setCurrentCurrency] = useState(currencyItem);
  const onTransToAud = (e) => {
    if (currentCurrency == "BTC") {
      let temp: number = +e;
      temp = temp * 1046.48;
      if (temp == 0) temp = null;
      if (e.toString() == transactionFee) {
        setTransactionFeeAud(String(temp));
        setCurrentCurrency("AUD");
      }
      if (e.toString() == sendCrypto) {
        setSendAud(String(temp));
        setCurrentCurrency("AUD");
      }
    }
  };
  const onSendOut = () => {
    if (currentCurrency == "AUD") {
      const togetherAud = +transactionFeeAud + +sendAud;
      if (togetherAud <= newDummyData.multiCoinStatus[0].AUD) {
        console.log("Congratulations!");
        Alert.alert("Congratulations!", "Money Send Out", [
          { text: "OK", onPress: () => console.log("OK Pressed") },
        ]);
      } else {
        console.log("Failed!");
        Alert.alert("Transaction Failed!", "You dont have enough money", [
          { text: "OK", onPress: () => console.log("OK Pressed") },
        ]);
      }
    }
  };
  const onTransToCrypto = (e) => {
    if (currentCurrency == "AUD") {
      let temp: number = +e;
      temp = temp % 1046.48;
      if (temp == 0) temp = null;
      if (e.toString() == transactionFee) {
        setTransactionFee(String(temp));
        setCurrentCurrency(currencyItem);
      }
      if (e.toString() == sendCrypto) {
        setSendCrypto(String(temp));
        setCurrentCurrency(currencyItem);
      }
    }
  };

  return (
    <View
      style={{
        marginTop: SIZES.padding,
        marginHorizontal: SIZES.padding,
        padding: SIZES.padding,
        borderRadius: SIZES.radius,
        backgroundColor: COLORS.white,
        ...styles.shadow,
      }}
    >
      <Form layout="horizontal">
        <View>
          <Form.Item
            extra={
              <div>
                <a>PASTE</a>
              </div>
            }
          >
            <Input placeholder="Recipient Address" clearable />
          </Form.Item>
        </View>
        {currentCurrency != "AUD" && (
          <View>
            <Form.Item
              extra={
                <div>
                  <a style={{ marginRight: 20 }}>MAX </a>
                  <a
                    onClick={() => {
                      onTransToAud(sendCrypto);
                    }}
                  >
                    {currentCurrency}
                  </a>
                </div>
              }
            >
              <Input
                type={"number"}
                placeholder="Amount"
                clearable
                value={sendCrypto}
                onChange={(e) => setSendCrypto(e)}
              />
            </Form.Item>
          </View>
        )}
        {currentCurrency == "AUD" && (
          <View>
            <Form.Item
              extra={
                <div>
                  <a style={{ marginRight: 20 }}>MAX </a>
                  <a
                    onClick={() => {
                      onTransToCrypto(sendCrypto);
                    }}
                  >
                    {currentCurrency}
                  </a>
                </div>
              }
            >
              <Input
                placeholder="Amount"
                clearable
                type={"number"}
                value={sendAud}
                onChange={(e) => setSendAud(e)}
              />
            </Form.Item>
          </View>
        )}
        {currentCurrency != "AUD" && (
          <View>
            <Form.Item
              extra={
                <div>
                  <a
                    onClick={() => {
                      onTransToAud(transactionFee);
                    }}
                  >
                    {currentCurrency}
                  </a>
                </div>
              }
            >
              <Input
                placeholder="Transaction Fee"
                clearable
                type={"number"}
                onChange={(e) => setTransactionFee(e)}
                value={transactionFee}
              />
            </Form.Item>
          </View>
        )}
        {currentCurrency == "AUD" && (
          <View>
            <Form.Item
              extra={
                <div>
                  <a onClick={() => onTransToCrypto(transactionFee)}>AUD</a>
                </div>
              }
            >
              <Input
                placeholder="Transaction Fee"
                clearable
                type={"number"}
                onChange={(e) => setTransactionFeeAud(e)}
                value={transactionFeeAud}
              />
            </Form.Item>
          </View>
        )}
        <View>
          <Form.Item>
            {" "}
            <TouchableOpacity
              onPress={() => onSendOut}
              style={[styles.button, { backgroundColor: "#023e3f" }]}
            >
              <Text style={styles.buttonText}>Submit</Text>
            </TouchableOpacity>
          </Form.Item>
        </View>
      </Form>
    </View>
  );
};

const styles = StyleSheet.create({
  shadow: {
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 4,
    },
  },
  button: {
    flex: 1,
    paddingVertical: 20,
    marginHorizontal: 8,
    borderRadius: 24,
    backgroundColor: "#1cb278",
  },
  buttonText: {
    color: "white",
    fontWeight: "600",
    textAlign: "center",
  },
});

export default Withdraw;
